var tipuesearch = {"pages": [{"url": "http://localhost:1313/post/about/", "text": "\u4e2a\u4eba\u4fe1\u606f: \u4f5c\u8005\u7684github\u8d26\u53f7\u4e3a: r1cs \u672c\u4eba\u4e3a\u4e00\u540d\u8ffd\u6c42\u300c\u9053\u5bb6\u300d\u54f2\u5b66\u7684\u4e0d\u5b58\u7cb9\u7684\u7a0b\u5e8f\u5458\u3002\u76ee\u524d\u4ece\u4e8b\u300c\u533a\u5757\u94fe\u300d\u76f8\u5173\u5de5\u4f5c,\u4e3b\u8981\u9886\u57df\u4e3a\u4ee5\u592a\u574a\u7684\u300cL2\u300d\u6269\u5bb9\u65b9\u6848\u3002\u5bf9\u54f2\u5b66\uff0c\u827a\u672f\uff0c\u6709\u7740\u81ea\u5df1\u7684\u7406\u89e3\u4e14\u4e0d\u4f1a\u88ab\u8f7b\u6613\u52a8\u6447\u3002\u4e5f\u5c1d\u8bd5\u548c\u4f19\u4f34\u4e00\u8d77\u521b\u4e1a\uff0c\u5982\u679c\u6709\u60f3\u6cd5\u7684\u670b\u53cb\uff0c\u4e0d\u8981\u4f4e\u4f30\u81ea\u5df1\u7684\u80fd\u529b\uff0c\u8bf7\u8054\u7cfb\u90ae\u7bb1: me@lxd.icu \u535a\u5ba2\u80cc\u666f: \u6211\u968f\u7740\u5e74\u5c81\u7684\u75f4\u957f\uff0c\u6e10\u6e10\u53d1\u73b0\u5927\u591a\u6570\u4eba\u90fd\u53ea\u662f\u4e16\u754c\u7684\u300c\u6d88\u8d39\u8005\u300d\u3002\u8fd9\u91cc\u7684\u300c\u4e16\u754c\u300d\u4e0d\u662f\u81ea\u7136\u4e3b\u4f53\uff0c\u800c\u662f\u4e2a\u4eba\u7684\u5bf9\u7acb\u9762\uff0c\u662f\u4e00\u79cd\u96c6\u4f53\u6027\u7684\u5ba2\u89c2\u4e8b\u7269\u3002\u5305\u62ec\u524d\u4eba\u7684\u667a\u6167\u3001\u52b3\u52a8\u6210\u679c\u3001\u751a\u81f3\u662f\u751f\u547d\u3002\u7ec6\u7ec6\u60f3\u6765\uff0c\u8fd9\u79cd\u73b0\u8c61\u5728\u533a\u5757\u94fe\u884c\u4e1a\u66f4\u4e3a\u666e\u904d\u3002\u6211\u7b2c\u4e00\u4efd\u5de5\u4f5c\u662f\u505a\u8054\u76df\u94fe\uff0c\u542c\u5230\u7684\u6700\u591a\u7684\u8bdd\u4fbf\u662f\uff1a\u201c\u8fd9\u6839\u672c\u6ca1\u4eba\u7528\u7684\uff0c\u5ba2\u6237\u5e0c\u671b\u6700\u597d\u53ea\u8dd1\u4e00\u4e2a\u8282\u70b9\u3002\u201d\u65e2\u7136\u5728\u505a\u4e00\u4ef6\u65e0\u610f\u4e49\u7684\u4e8b\u60c5\uff0c\u90a3\u4e3a\u4ec0\u4e48\u8fd8\u8981\u505a\u4e0b\u53bb\u5462\uff1f\u62b1\u7740\u8fd9\u4e2a\u60f3\u6cd5\uff0c\u6211\u5c06\u76ee\u5149\u6295\u5411\u4e86\u516c\u94fe\u3002\u5f53\u65f6\u7684\u6211\u9762\u4e34\u7740\u4e24\u4e2a\u9009\u62e9\uff0c\u300c\u4ee5\u592a\u574aLayer2\u300d\u548c\u300c\u96f6\u77e5\u8bc6\u8bc1\u660e\u300d\u3002\u96f6\u77e5\u8bc6\u8bc1\u660e\u5728\u5f53\u65f6\u79bb\u843d\u5730\u8fd8\u6709\u4e00\u6bb5\u8ddd\u79bb\u3002\u6240\u4ee5\u6211\u9009\u62e9\u4e86Layer2\uff0c\u8fd9\u4e2a\u6700\u7e41\u534e\u7684\u516c\u94fe\u751f\u6001\u91cc\u524d\u666f\u6700\u5e7f\u7684\u9879\u76ee\u4ee4\u6211\u770b\u5230\u4e86\u5e0c\u671b\u3002\u5f53\u505a\u4e86\u5c06\u8fd1\u4e24\u5e74\uff0c\u6211\u53d1\u73b0\u6211\u8fd8\u662f\u4ece\u672a\u5411\u8fd9\u4e2a\u4e16\u754c\u8f93\u51fa\u8fc7\u4efb\u4f55\u6709\u4ef7\u503c\u7684\u4e1c\u897f\uff0c\u4e5f\u8bb8\u5f53\u5b83\u4e0a\u7ebf\u7684\u65f6\u5019\uff0c\u6211\u4f1a\u8f93\u51fa\u3002\u4e0d\u8fc7\u5176\u4e2d\u6709\u4e00\u6b21\u8ba9\u6211\u611f\u53d7\u6211\u4e5f\u662f\u4e16\u754c\u7684\u300c\u751f\u4ea7\u8005\u300d\u7684\u65f6\u523b\u662f\uff0c\u548c\u4f19\u4f34\u641e\u4e86\u4e00\u4e2a\u5c0f\u9879\u76ee\uff0c\u88ab\u522b\u4eba\u611f\u8c22\uff0c\u4f7f\u7528\uff0c\u5e76\u4e14\u8fd8\u88ab\u5b98\u65b9\u53d1\u73b0\u7684\u65f6\u5019\u3002\u6211\u77e5\u9053\u4e86\uff0c\u6211\u7684\u9879\u76ee\u7684\u610f\u4e49\u5e76\u4e0d\u662f\u5728\u4e8e\u6210\u529f\uff0c\u800c\u662f\u5728\u4e8e\u62e5\u6709\u521b\u9020\u4ef7\u503c\u7684\u53ef\u80fd\u6027\u3002\u8fd9\u79cd\u53ef\u80fd\u6027\u624d\u662f\u6700\u8ff7\u4eba\u7684\u3002 \u6240\u4ee5\u4ee5\u6b64\u4e3a\u5951\u673a\uff0c\u6211\u60f3\u901a\u8fc7\u535a\u5ba2\u5411\u4e16\u754c\u8f93\u51fa\u4e00\u4e9b\u4ef7\u503c\u3002\u867d\u7136\u8f93\u51fa\u7684\u4e1c\u897f\u4e5f\u662f\u5480\u56bc\u4e86\u524d\u4eba\u7684\u667a\u6167\u6240\u5269\u7684\u6b8b\u6e23\uff0c\u4f46\u662f\u5982\u679c\u5341\u7bc7\u6587\u7ae0\u4e2d\uff0c\u6709\u90a3\u4e48\u4e00\u4e24\u4e2a\u5b57\u5bf9\u54ea\u6015\u90a3\u4e48\u4e00\u4e2a\u8bfb\u8005\u6765\u8bf4\u662f\u6709\u4ef7\u503c\u7684\uff0c\u90a3\u4fbf\u662f\u6210\u529f\u7684\u3002x D", "tags": "blog about", "title": "\u6211\uff0c\u535a\u5ba2\uff0c\u4ee5\u53ca\u4e16\u754c - Pixyll"}]};